import React from 'react'
import '../styles/Input.css'

const Input = props => {
    return(
        <div className='InputWrapper'>
            <input name='UserInput' className="UserInput" value={props.userInput} onChange={props.handleUserInputChange} />
        </div>
    )
}

export default Input
